import ComponentMenu from './waiter/Menu.js'
import ComponentHome from './home/Home.js'
import ComponentParticles from './home/Particles.js'
import './App.css';

class App extends Component {
  render(){
      return (  
          <>
              <ComponentParticles/>
              <ComponentHome/> 
              <ComponentMenu/>       
          </> 
      );
  }
}

export default App;
